import React, {Component} from 'react';
import { NavLink } from "react-router-dom";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Add from '@material-ui/icons/Add'
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import DateTimeRangePicker from '@wojtekmaj/react-datetimerange-picker';
import DateTimePicker from 'react-datetime-picker'

class Popup extends Component {
  state = {
    open: false,
    multiline:"",
    date: new Date(),
  };

  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value,
    });
  };

  onChange = date => this.setState({ date })

  render() {
    const { classes } = this.props;
    const {title}=this.props
    return (
      <div>
        <Button variant="outlined" color="primary" onClick={this.handleClickOpen}>
          <Add/> Agendar cita
        </Button> 
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="form-dialog-title"
          style={{height:"800px"}}
        >
          <DialogTitle id="form-dialog-title">{title}</DialogTitle>
          <DialogContent>
            <Grid container direction="row" justify="space-between" alignItems="baseline" spacing="16">
              <Grid item xs={5}>  
                <Grid container justify="space-between" alignItems="center">
                  <Grid item xs={4} paddingBottom="5px">Paciente:</Grid>
                  <Grid item xs={8} margin="none">
                    <TextField
                      id="standard-search"
                      label="buscar paciente..."
                      type="search"
                      margin="normal"
                    />
                  </Grid>
                </Grid>
              </Grid>  
              <Grid item xs={2} align="center">o</Grid>
              <Grid item xs={5}>
                <NavLink to="/pacientes">
                  <Button variant="outlined" color="primary">
                    <Add/>
                    Nuevo Paciente
                  </Button>
                </NavLink>
              </Grid>
            </Grid>
            <Grid container direction="row" justify="space-between" alignItems="baseline" spacing="16">
              <Grid item xs={2}>Fecha:</Grid>
              <Grid item xs={10}>
                <DateTimePicker
                  onChange={this.onChange}
                  value={this.state.date}
                  disableClock
                  isOpen
                />              
              </Grid>
              <Grid item xs={2}>Duración:</Grid>
              <Grid item xs={10}>
                    <TextField
                      id="standard-search"
                      label="buscar paciente..."
                      value="45"
                      type="search"
                      margin="normal"
                    />            
              </Grid>
              <Grid item xs={12}>
                <TextField
                  id="outlined-multiline-flexible"
                  label="Descripción (opcional)"
                  multiline
                  rowsMax="4"
                  value={this.state.multiline}
                  onChange={this.handleChange('multiline')}
                  margin="normal"
                  variant="outlined"
                  fullWidth
                />
              </Grid>
            </Grid>
          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleClose} color="secondary">
              Cerrar
            </Button>
            <Button onClick={this.handleClose} variant="contained" color="primary">
              Agendar cita
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}

export default Popup;
